import React, {Component} from "react";
import "./layout.scss";



class Layout extends Component {

    render() {
        return (
            <div className="main-container">

            <Login/>

            <Navi/>

            <SectionInfo/>

            <SectionAchi/>

            <SectionSteps/>

            <SectionUs/>

            <SectionFoundation/>

            <ContactFooter/>

            </div>
        )}
}



export default Layout;
